select trx.transaction_date , trx.message_id , trx.telecom_id , trx.client_sender_id , trx.status_code, tsv.vendor_trx_status
--select trx.transaction_date, trx.message_id, trx.batch_id, trx.client_sender_id,
--tel.telecom_name, trx.msisdn, trx.message, trx.status_code,
--stat.description as status_description, trf.previous_balance, trf.usage, trf.after_balance,
--con.country_name, trx.sms_count, trx.api_username, trx.client_id, cli.client_name, tsv.vendor_id, vs.vendor_name 
from transaction_sms trx
--left join transaction_status stat 		on trx.status_code = stat.status_code
--left join transaction_sms_financial trf on trx.message_id = trf.message_id
--left join country con 					on trx.country_code = con.country_id
--left join client cli 					on trx.client_id  = cli.client_id
--left join telecom tel 					on trx.telecom_id = tel.telecom_id
left join transaction_sms_vendor tsv	on trx.message_id = tsv.message_id
--left join vendor_sms vs					on tsv.vendor_id  = vs.vendor_id 
where trx.transaction_date >= '2023-07-1 00:00:00.000'
and trx.transaction_date < '2023-08-07 00:00:00.000'
and trx.client_id = 'MA20230412190819'
order by trx.transaction_date desc;

select from transaction_sms_financial tsf where tsf.client_id = 'KI20230318131246' and tsf.transaction_datetime >= '2023-02-01' and tsf.transaction_datetime <= '2023-07-31';



--select routing_id, rts.client_id, vendor_parameter_json, client_user_api, vendor_sender_id_id 
--from routing_table_sms rts 
--left join user_api ua on rts.client_user_api = ua.username 
--where vendor_id = 'VJLE190318' and ua.access_type like '%HTTP%'; 
