select tsr.message_id, tsr.receiver_date_time, tsr.receiver_client_response_date_time
from transaction_sms_receiver tsr 
left join transaction_sms ts on ts.message_id = tsr.message_id 
where ts.transaction_date >= '2023-08-23 13:50:00' and transaction_date <= '2023-08-23 14:10:00' and client_id = 'MA20230412190819'
order by ts.transaction_date desc;


